  return (
    <section className="intro">
      <div className="intro-heading">
        <h1>Hi, I'm Yusuf.</h1>
        <h3>A software developer by day, superhero by night*</h3>
        <p></p>
      </div>
    </section>
  );
};

export default Intro;
